import React from "react";
import { useSelector } from "react-redux";

import Table from "./Table";

const Main = () => {
   const matrixData = useSelector((state) => state.matrix.data);

   return (
      <main>
         {matrixData.length === 0 ? (
            <p>Please, set the start settings for the table</p>
         ) : (
            <Table />
         )}
      </main>
   );
};

export default Main;
